import React from 'react';

export const Notes = ({ notes }) => {
    return (
        <div>
            <ul class="list-group">
                {notes.map(note => (
                    <li
                        class="list-group-item"
                        key={note.id}
                    >{note.title}</li>))}

            </ul>
        </div>
    );
}
